import '../App.css';
import Bebop from './images/bebop.png'

function Projects() {
    return (
        <div className="projects">
            <h2>Projects</h2>
            <div class="card bg-dark text-white">
                <img src="" class="card-img" alt="bebop app" />
                <div class ="card-img-overlay">
                <h5 class ="card-title">Bebop</h5>
                <p class ="card-text">A music based social media platform</p>
                </div>
            </div>

        </div>
    )
}
export default Projects;
